EncryptString(string) {
    encryptedString := ""
    Loop, Parse, string
    {
        char := Asc(A_LoopField)
        char += 5
        encryptedString .= Chr(char)
    }
    return encryptedString
}

DecryptString(encryptedString) {
    decryptedString := ""
    Loop, Parse, encryptedString
    {
        char := Asc(A_LoopField)
        char -= 5
        decryptedString .= Chr(char)
    }
    return decryptedString
}

