char* printerError(char *s) {
  int errors, total;
  errors = total = 0;
  
  while (*s) {
    char c = *s++;
    total++;
    if (c < 'a' || c > 'm')
      errors++;
  }
  
  char* result;
  asprintf(&result, "%d/%d", errors, total);
  return result;
}

#include <stdlib.h>

int find_outlier(const int* values, size_t count) {
    int last_even, last_odd;
    int n_even, n_odd;
    last_even = last_odd = n_even = n_odd = 0;

    for (size_t i = 0; i < count; i++) {
        if (values[i] % 2 == 0) {
            last_even = values[i];
            n_even++;
        } else {
            last_odd = values[i];
            n_odd++;
        }
    }

    return n_even > n_odd ? last_odd : last_even;
}

