class Solution {
    public boolean canConstruct(String ransomNote, String magazine) {
        int l1 = ransomNote.length();
        int l2 = magazine.length();

        if (ransomNote == null || magazine == null)
            return false;

        if (l1 > l2)
            return false;

        int[] count1 = new int[26];
        int[] count2 = new int[26];

        for (int i=0; i<l1; i++)
            count1[ransomNote.charAt(i)-'a']++;
    
        for (int i=0; i<l2; i++)
            count2[magazine.charAt(i)-'a']++;

        for (int i=0; i<26; i++) {
            if (count1[i] > count2[i])
                return false;
        }
        return true;
    }
}

public class Solution extends VersionControl {
    public int firstBadVersion(int n) {
        int lo = 0;
        int hi = n;
        int mid;
        int  ans = -1;
        boolean type;

        while( lo <= hi ) {
            mid = lo + (hi-lo) / 2;
            type = isBadVersion(mid);
            System.out.println(mid);

            if (type == true){
                ans = mid;
                hi = mid-1;
            } else {
                lo = mid+1;
            }
        }
        return ans;
    }
}
